apps.description:
SeniorMatch is a senior dating & social app specially designed for mature men and mature women aged 50 or plus. It is the official dating app of SeniorMatch. Unlike elsewhere, only verified members can connect with you here, ensuring unmatched security while also offering more privacy control than all other sites. It's a safe and warm senior community for flirting, chatting, and connecting with local senior singles. 
Meet mature men and meet mature women with the senior dating app for singles over 50. With our mature dating service, you’ll be proud of your age and celebrate the prime of your life by having a fresh start in dating scene in our 50 plus community. 

Maybe you just broke up with a long-term relationship or your love passed on, or maybe you have been lonely but not confident about the flirting skills, do not worry and join us, you’ll always find support and companion from other people who are in the exact same situation as you. At here, you are not alone.
The existing senior dating apps are in fact dating apps for all ages only with senior options, which means they are mainly catering to the young generations. But we came up with Senior Match with the sole purpose: to help the living-alone singles make genuine connections with real people by meaningful conversations.

What makes SeniorMatch unique?
- Unlike elsewhere, only verified members can connect with you on SeniorMatch;
- We offer more privacy control than any other platforms;
- It is totally FREE to register and browse all the like-minded people’s profiles;
- Senior Match restricts registration of members to age 50 and up. All our members are at your age in the same situation as you;
- To ensure the best quality of matches for you, we review every profile and block out all the easy-profiles;
- Senior Match welcomes all mature singles to join, no matter you are a bi, gay, lesbian, or anything in-between, you’ll feel comfortable and find a safe space here;

Highlighted features:
- Senior Community: Meet new friends and make meaningful connections with singles over 50s;
- Meet: Browse unlimited verified profiles of 50+ singles near or far;
- Message: Start conversations with or reply to other verified members;
- Profile: Show off your fabulous senior life with pictures, and self-introduction;

Senior Match is free to download and use, however if you’re looking to get the most from the senior dating, you can subscribe to our optional Premium subscriptions. We have multiple subscription options to choose from:
One month subscription: $34.99
Three months subscription: $69.99
Six months subscription: $109.99

- Payment will be charged to your iTunes account at confirmation of purchase. 
- Your subscription will automatically renew itself, unless auto-renewal is turned off at least 24 hours before the end of the current period. 
- Your account will be charged for renewal within 24-hours prior to the end of the current period. 
- You can manage your subscriptions and turn off auto-renewal by going to your Account Settings in the iTunes Store. 
- If offered, if you choose to use our free trial, any unused portion of the free trial period will be forfeited when you purchase a subscription to that publication, where applicable 
- If you don’t choose to purchase SeniorMatch Premium, you can simply continue using and enjoying our service for free.

Your personal data is safe with us:
- You can view our Privacy Policy at https://www.seniormatch.com/privacyPolicy
- You can view our Service Agreement at https://www.seniormatch.com/serviceAgreement

To those baby boomers who are old at age but young at heart, you deserve to have a fresh start on senior dating journey! 
Join Senior Match now - the exclusive dating app for your generation, you’ll find the exact place where you feel you belong!

